    [],nt"num_tags": 32,nt"name": "annual-narrative-report-1998-patuxent-research-refuge",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Patuxent
    Research Refuge outlines Refuge accomplishments during 1998. The report begins with
    a summary of the year's highlights and weather conditions. The report includes a
    planning section which discusses research and investigations. Refuge administration
    is outlined; information about personnel, volunteer programs, funding, and safety
    is given. Habitat management is also covered; subjects include wetlands, croplands,
    grasslands, pest control, and water rights. The wildlife section of the report discusses
    waterfowl, marsh birds and waterbirds, shorebirds, raptors, fisheries resources,
    marking and banding, and disease control. The public uses of the Refuge described
    in this report include outdoor classrooms, interpretive programs, hunting, wildlife
    observation, outdoor recreation, and law enforcement. Cooperative programs and economic
    uses of the Refuge are provided at the end.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
